        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>RealEstate AI Bot</h1>
            <p>Welcome to the RealEstate AI Bot!</p>
            <p>This page is currently under construction.</p>
            <p>Stay tuned for updates.</p>
        </div>
    );
};

export default RealEstateBot;
